        isHeavyCloud: [],
        isSun: [],
        isRain: [],
        isHeavyRain: [],
        isHail: [],
        isSnow: [],
        isThunderstorm: [],
        isWind: [],
        isWindSun: [],
        isWindCloud: [],
        isCloudSun: []
    }; 

